import React from 'react';
import { Box, Center, GluestackUIProvider, VStack } from '@gluestack-ui/themed';
import { config } from '@gluestack-ui/config';

export default function ViewNotePage() {
    return (
        <GluestackUIProvider config={config}>
            <Center>
            <Box h='$80' justifyContent='center'>
                <VStack space="none" reversed={false} >
                    <Box w='$20' h='$20' bg='$blue300' />
                    <Box w='$20' h='$20' bg='$blue400' />
                    <Box w='$20' h='$20' bg='$blue500' />
                </VStack>
            </Box>
            </Center>
        </GluestackUIProvider>
    );
}
